export default class Note extends Component {
  constructor(props) {
    super(props);
    this.state = { lists: [] };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5000/list/")
      .then((response) => {
        console.log(response.data);
        this.setState({ lists: response.data });
      })
      .catch((error) => {
        console.log(error);
      });
  }
}

